import "./App.css";
import { useState, useEffect, useContext, createContext } from "react";

// quick helper function to easily convert to title case
function titleCase(str) {
    return str.toLowerCase().replace("-", " ").split(' ').map(w => w[0].toUpperCase() +
           w.substring(1).toLowerCase()).join(' ');
}

const PlaneToMoveContext = createContext({
    planeToMove: null,
    setPlaneToMove: () => {}
});

const SpotARepaintContext = createContext({
    repaint: false,
    setRepaint: () => {}
});
const SpotBRepaintContext = createContext({
    repaint: false,
    setRepaint: () => {}
});
const SpotCRepaintContext = createContext({
    repaint: false,
    setRepaint: () => {}
});

const spotContexts = {
    "ramp-a": SpotARepaintContext,
    "ramp-b": SpotBRepaintContext,
    "ramp-c": SpotCRepaintContext
};

// REMOVE THIS SOON
// transfers all planes into planeBox on app start
const origData = require("./data.json");
origData.planes.forEach((plane) => {
    plane.spot = "planeBox";
    origData.spots.planeBox.plane.push(plane);
});

function RampBox() {
    return (
        <div id="ramp" className="box">
            <div className="box title-box" style={{"fontSize": 1.5+"em"}}>
                Ramp
            </div>
            <table className="table-list" border="1" frame="void" rules="rows">
                <tbody>
                    <RampBoxItem name="ramp-a" />
                    <RampBoxItem name="ramp-b" />
                    <RampBoxItem name="ramp-c" />
                    <RampBoxItem name="ramp-d" />
                    <RampBoxItem name="ramp-e" />
                    <RampBoxItem name="ramp-f" />
                    <RampBoxItem name="ramp-g" />
                    <RampBoxItem name="ramp-h" />
                    <RampBoxItem name="ramp-i" />
                    <RampBoxItem name="ramp-j" />
                    <RampBoxItem name="ramp-k" />
                    <RampBoxItem name="ramp-l" />
                    <RampBoxItem name="ramp-m" />
                    <RampBoxItem name="ramp-n" />
                    <RampBoxItem name="ramp-o" />
                    <RampBoxItem name="ramp-p" />
                    <RampBoxItem name="ramp-q" />
                    <RampBoxItem name="ramp-r" />
                </tbody>
            </table>
        </div>
    );
}

function RampBoxItem({ name }) {

    console.log(name);

    const { planeToMove, setPlaneToMove } = useContext(PlaneToMoveContext);
    //const { repaintSpots, setRepaintSpots } = useContext(RepaintSpotsContext);

    const [spotData, setSpotData] = useState(null);
    useEffect(() => {
        console.log("here");
        async function getSpotData() {
            const response = await fetch("http://localhost:8080/getSpot?spot=" + name);
            return response.json();
        }
        getSpotData()
            .then(spotData => setSpotData(spotData))
            .catch(e => console.log(e));
    }, [name]);

    //const tempRepaintSpots = repaintSpots.filter(spot => spot !== name);
    //setRepaintSpots(tempRepaintSpots);

    async function customMoveHere() {
        if (planeToMove) {
            fetch("http://localhost:8080/movePlane?plane=" + planeToMove + "&spot=" + name)
                .catch(e => console.log(e));
            //setPlaneToMove(null);
        }
    }

    if (spotData) {
        let plane;
        if (spotData.plane) {
            plane = (
                <Plane plane={spotData.plane} />
            );
        }
        let glow = (planeToMove && !spotData.plane ? "glow" : "");
        let upperChar = name.replace("ramp-", "").toUpperCase();
        return (
            <tr id={name} className={glow} onClick={() => customMoveHere()}>
                <td>{upperChar}</td>
                <td>{plane}</td>
            </tr>
        );
    }
}

