                                        <DirectionBoxItem name="kcfj"
                                            data={data} updateData={updateData}
                                            moveMode={moveMode} setMoveMode={setMoveMode}
                                            moveHere={moveHere} />
                                        <DirectionBoxItem name="kfkr"
                                            data={data} updateData={updateData}
                                            moveMode={moveMode} setMoveMode={setMoveMode}
                                            moveHere={moveHere} />
                                    </tr>
                                </tbody>
