function TDoorsBoxItem({ name, data, updateData, moveMode, setMoveMode, moveHere }) {
    let plane;
    if (data.spots[name].plane) {
        plane = (
            <Plane plane={data.spots[name].plane} moveMode={moveMode}
                setMoveMode={setMoveMode} />
        );
    }
    let glow = (moveMode && !data.spots[name].plane ? "glow" : "");
    let n = name.replace("t-", "");
    return (
        <tr id={name} className={glow}
                onClick={() => moveHere(name, data, updateData, moveMode, setMoveMode)}>
            <td>{n}</td>
            <td>
                {plane} 
            </td>
        </tr>
    );
}

function PlaneBox({ moveMode, setMoveMode }) {
    const [planes, setPlanes] = useState(null);
    useEffect(() => {
        async function getPlanes() {
            const response = await fetch("http://localhost:8080/getSpot?spot=planeBox");
            return response.json();
        }
        getPlanes().then(planes => setPlanes(planes.plane)).catch(e => console.log(e));
    }, []);

    if (planes) {
        const planeElements = [];
        planes.forEach((plane) => {
            planeElements.push(
                <Plane plane={plane} moveMode={moveMode} setMoveMode={setMoveMode} />
            );
        });
        return (
            <div>
                {planeElements}
            </div>
        );
    }
}

function Plane({ plane }) {

    const { planeToMove, setPlaneToMove } = useContext(PlaneToMoveContext);

    let planeClass = "plane " + plane.type;
    if (planeToMove === plane.tailNumber) {
        planeClass += " glow";
    }
    return (
        <span id={plane.tailNumber} className={planeClass}
                onClick={() => setPlaneToMove(plane.tailNumber)}>
            {plane.tailNumber}
        </span>
    );

}

export default function App() {

    const [planeToMove, setPlaneToMove] = useState(null);

    const [spotARepaint, setSpotARepaint] = useState(false);

    // remove these 
    const [data, updateData] = useState(origData);
    const [moveMode, setMoveMode] = useState(null);


    useEffect(() => {
        let mount = true;
        let events;
        let timer;
        let createEvents = () => {
            if(events){
                events.close();
            }
            events = new EventSource(`http://localhost:8080/events`);
            events.onmessage = (event) => {
                if(mount){

                    let parsedData = JSON.parse(event.data);
                    console.log(parsedData);

                    /*
                    let tempRepaintSpots = repaintSpots;
                    tempRepaintSpots.push(event.data.newSpot.spotName);
                    tempRepaintSpots.push(event.data.oldSpot.spotName);
                    setRepaintSpots(tempRepaintSpots);
                    */

                    setPlaneToMove(null);

                    console.log(planeToMove);


                }
            };
            events.onerror = (err) => {
                timer = setTimeout(() => {
                    createEvents();
                }, 1000);
            };
        };
        createEvents();
        return () => {
            mount = false;
            clearTimeout(timer);
            events.close();
        }
    }, [planeToMove, setPlaneToMove]);


    // REMOVE SOON
    // function to move plane
    async function moveHere(spotName, moveMode, setMoveMode) {
        if (moveMode) {
            await fetch(
                "http://localhost:8080/movePlane?plane=" + moveMode + "&spot=" + spotName);
            setMoveMode(null);
        }
    }

    return (
        <div>
            <PlaneToMoveContext.Provider value={{ planeToMove, setPlaneToMove }}>
            <SpotARepaintContext.Provider value={{ spotARepaint, setSpotARepaint}}>
                <div id="frame">
                    <div id="title" className="box title-box">
                        <h1>Aircraft Locations</h1>
                    </div>
                    <RampBox />
                    <DirectionBox
                        data={data}
                        updateData={updateData}
                        moveMode={moveMode}
                        setMoveMode={setMoveMode}
                        moveHere={moveHere}
                    />
                    <HangarsBox
                        data={data}
                        updateData={updateData}
                        moveMode={moveMode}
                        setMoveMode={setMoveMode}
                        moveHere={moveHere}
                    />
                    <OtherBox
                        data={data}
                        updateData={updateData}
                        moveMode={moveMode}
                        setMoveMode={setMoveMode}
                        moveHere={moveHere}
                    />
                    <TDoorsBox
                        data={data}
                        updateData={updateData}
                        moveMode={moveMode}
                        setMoveMode={setMoveMode}
                        moveHere={moveHere}
                    />
                </div>
                <div id="note">
                    Made with love by Johnny Burrer :)
                    Reach out on GroupMe with any feedback/bug reports!
                </div>
                <PlaneBox
                    moveMode={moveMode}
                    setMoveMode={setMoveMode}
                /> 
            </SpotARepaintContext.Provider>
            </PlaneToMoveContext.Provider>
        </div>
    );
}
